class Mover {
	constructor(x, y, z, m, radius, widthSeg, heightSeg, scene) {
		this.geometry = new THREE.SphereBufferGeometry(
			radius,
			widthSeg,
			heightSeg
		)
		// this.testGeo = new THREE.BoxGeometry(5, 5, 5)
		// this.material = new THREE.MeshBasicMaterial({ color: '#ff00ff' })
		this.material = new THREE.ShaderMaterial({
			uniforms: {
				tExplosion: {
					type: 't',
					value: doorColorTextures,
				},
				uTime: { value: 0 },
				uFreq: { value: 0 },
			},

			vertexShader: vertex,
			fragmentShader: fragment,
		})

		this.geometry = new THREE.IcosahedronGeometry(2, 10)
		this.mesh = new THREE.Mesh(this.geometry, this.material)
		this.position = new THREE.Vector3(x, y, z)

		this.vel = new THREE.Vector3(
			Math.random() * 1 - 0.5,
			Math.random() * 1 - 0.5,
			Math.random() * 1 - 0.5
		)
		this.scene = scene
		this.acc = new THREE.Vector3(0, 0, 0)
		this.mass = m
		// this.mesh = new THREE.Mesh(this.testGeo, this.material)
	}

	applyForce(force) {
		let f = force
		this.acc.add(f)
	}

	checkBoundaries() {
		let mp = this.mesh.position
		// // console.log(mp)
		if (mp.x > 150 || mp.x < -150) {
			this.vel.multiplyScalar(-1)
		}
		if (mp.y > 75 || mp.y < -75) {
			this.vel.multiplyScalar(-1)
		}
		if (mp.z > 100 || mp.z < -100) {
			this.vel.multiplyScalar(-1)
		}
	}
	addToScene() {
		this.mesh.position.set(
			this.position.x,
			this.position.y,
			this.position.z
		)
		scene.add(this.mesh)
		tempGroup.add(this.mesh)
	}
	update() {
		this.material.uniforms.uTime.value = 0.00025 * (Date.now() - start)
		this.vel.add(this.acc)
		this.vel.clampScalar(-0.35, 0.35) // clamp speed
		this.mesh.position.add(this.vel)
		this.acc.set(0, 0, 0)
	}
}
